import styled from 'styled-components';

export const Main = styled.main`{  
    margin-top: 10vh;
    max-height: 90vh;
    scroll-snap-type: y mandatory; 
    background-color: var(--black);
    color: var(--grayLight);
    overflow-y: scroll;
}
`;
